function Home() {
  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h2>Selecciona</h2>
      <div style={{ marginTop: "20px" }}>
        <button style={{ marginRight: "10px", padding: "10px 20px" }}>
          Sociedad
        </button>
        <button style={{ padding: "10px 20px" }}>
          Autonomo
        </button>
      </div>
    </div>
  );
}

export default Home;
